import React from 'react';
import './style/App.css';
import Home from './Home';
import Header from './Header';
import Footer from './Footer';

function App() {

  return (
    <React.Fragment>
      <div className="App">
          <Header />
          <Home />
          <Footer />
      </div>
    </React.Fragment>
  );
}

export default App;
